import React, { useEffect, } from 'react';
import { Button, Breadcrumb, Row, Col, Space, Image,Form,Card } from 'antd';
import { useSelector, useDispatch } from 'react-redux'
import ListWapper from "../common/ListWapper";
import { useNavigate, useParams } from 'react-router-dom';
import { useIntl } from 'react-intl';
import { AiFillBackward } from "react-icons/ai";
import { resetSingleData, feachSingleData } from '../../store/UsersRedux'

const Details = () => {
    const navigate = useNavigate()
    const dispatch = useDispatch()
    const { messages } = useIntl();
    const params = useParams()
    const token = useSelector((state) => state.auth.token)
    const singleres = useSelector((state) => state.auth.singleres)

    useEffect(() => {
        // Load Details Data
        if (params.id) {
            dispatch(feachSingleData({ ...params, token }))
        }
        // Reset Date When Exit From Page
        return () => {
            dispatch(resetSingleData(null))
        }
    }, []);

    const onFinish = (values) => {
        console.log(values)
    };

    console.log(singleres)
    const tailLayout = {
        wrapperCol: {
            offset: 8,
            span: 16,
        },
    };

    return (<ListWapper>
        <Form name='dynamic_rule' onFinish={onFinish}>
            <Card className='user-card user-card-lg' >
                <Space>
                    <Breadcrumb separator='>'>
                        <Breadcrumb.Item>{messages['sidebar.app.manageusers']}</Breadcrumb.Item>
                        <Breadcrumb.Item>{messages['user.view']}</Breadcrumb.Item>
                    </Breadcrumb>
                </Space>
                <div className='profile-border'></div>
                <Space className='user-img' >
                    <Image
                        width={300}
                        height={300}
                        src='error'
                        fallback='data:image/png;base64,'
                    />
                </Space>
                <Row gutter={{ xs: 20, sm: 16, md: 32 }} >
                    <Col xs={24} lg={4} key='collapse-a'></Col>
                    <Col xs={24} lg={11} key='collapse-a'>
                        <div className="user-view">
                            <h5>{messages['common.name']}</h5>
                            <p>{singleres.profile?.name}</p>
                        </div>
                        <div className="user-view">
                            <h5>{messages['user.phone']}</h5>
                            <p>{messages['user.number']}</p>
                        </div>
                        <div className="user-view">
                            <h5>{messages['user.age']}</h5>
                            <p>{singleres.profile?.age}</p>
                        </div>
                        <div className="user-view">
                            <h5>{messages['user.interests']}</h5>
                            <p>{messages['user.fashion']}</p>
                        </div>
                        <div className="user-view">
                            <h5>{messages['user.wishlist']}</h5>
                            <p>{messages['user.nike']}</p>
                        </div>
                        <div className="user-view">
                            <h5>{messages['user.device']}</h5>
                            <p>{messages['user.iPhone']}</p>
                        </div>
                        <div className="user-view">
                            <h5>{messages['user.mobile']}</h5>
                            <p>{messages['user.airtel']}</p>
                        </div>
                    </Col>
                    <Col xs={24} lg={9} key='collapse-a' >
                        <div className="user-view">
                            <h5>{messages['user.details']}</h5>
                            <p>{singleres.userID}</p>
                        </div>
                        <div className="user-view">
                            <h5>{messages['user.gender']}</h5>
                            <p>{singleres.profile?.gender}</p>
                        </div>
                        <div className="user-view">
                            <h5>{messages['user.status']}</h5>
                            <p>{(singleres.online) ? 'Active' : 'Inactive'}</p>
                        </div>
                        <div className="user-view">
                            <h5>{messages['dashboard.following']}</h5>
                            <p>{messages['User.puma']}</p>
                            <h5>{messages['upload.brands']}</h5>
                            <h5>{messages['brand.influencers']}</h5>
                        </div>
                        <div className="user-view">
                            <h5>{messages['user.bandwidth']}</h5>
                            <p>{messages['user.wifi']}</p>
                        </div>
                    </Col>
                </Row>
            </Card>
        </Form>
    </ListWapper>
    );
};


export default Details;
